import React from 'react';
import './BandeauHaut.css';
import BoutonOuvert from '../images/BoutonOuvert.png';

export default class Nav extends React.Component {
    
    render() {
        return(
            <div>
                <img src={BoutonOuvert} alt="imgLogo" className="logo"></img>
                <a className="actu" href="">Actu</a>
                <a className="team" href="">Team</a>
                <a className="cta" href="">CTA</a>
            </div>
        );
    }
}
